  false,\n\t\"url\": null,\n\t\"notes\": \"This study focuses on the development of
  a 20 attribute lake cover classification scheme for the Fish Creek Watershed (FCW),
  which is located in the National Petroleum Reserve-Alaska (NPR-A). The GIS dataset
  consists of 4,362 lakes (which were extracted from a 5m resolution IfSAR/orthophoto
  image) covering 18% of the 4,900 km2 FCW and provides information on lake morphometry,
  hydrologic connectivity, surface area dynamics, surrounding terrestrial ecotypes,
  and other important aquatic conditions. The FCW lake cover classification scheme
  provides lake specific information for an arctic watershed that will guide research
  and aid in the management of the natural and human-modified environment.\",\n\t\"license_title\":
